import { createRouter, createBrowserHistory } from 'vue-router'
import Operation from '../components/Operation.vue'
import Vehicle from '../components/Vehicle.vue'
import Customer from '../components/Customer.vue'
import Plan from '../components/Plan.vue'
import Contract from '../components/Contract.vue'

const routes = [
  {
    path: '/operation',
    name: 'Operation',
    component: Operation
  },
  {
    path: '/vehicle',
    name: 'Vehicle',
    component: Vehicle
  },
  {
    path: '/customer',
    name: 'Customer',
    component: Customer
  },
  {
    path: '/plan',
    name: 'Plan',
    component: Plan
  },
  {
    path: '/contract',
    name: 'Contract',
    component: Contract
  },
]
const router = createRouter({
  history: createBrowserHistory(process.env.BASE_URL),
  routes
})
export default router
